  \"2016-08-05T08:15:11.715777\",\n\t\"name\": \"alaska-peninsula-becharof-national-wildlife-refuge-complex-annual-narrative-report-calen-1-402fb\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Alaska
  Peninsula and Becharof NWRs outlines Refuge accomplishments during the 1993 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, public participation, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, volunteer programs, funding, and safety
  is given. Habitat management is also covered; subjects include wilderness areas.
  The wildlife section of the report discusses waterfowl, shorebirds, game mammals,
  marine mammals, and marking and bird banding. The public uses of the Refuge described
  in this report include outdoor classrooms, interpretive programs, hunting, fishing,
  trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about rehabilitation,
  major maintenance, equipment replacement, communication systems, and computer systems.
  Cooperative programs, economic uses of the Refuge, and items of interest are provided
  at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
